def compare_sets(set1: set, set2: set):
    """Compare two sets and print non-overlapping elements."""
    if set1 == set2:
        print("The sets contain the same elements.")
    else:
        print("The sets do NOT contain the same elements.")
        # Elements in set1 but not in set2
        only_in_set1 = set1 - set2
        # Elements in set2 but not in set1
        only_in_set2 = set2 - set1
        if only_in_set1:
            print("Only in first set:", only_in_set1)
        if only_in_set2:
            print("Only in second set:", only_in_set2)
